tables.table_schema:
CREATE TABLE demographic_data (
  id INT PRIMARY KEY,
  age INT,
  gender VARCHAR,
  ethnicity VARCHAR
);

CREATE TABLE educational_programs (
  program_id INT PRIMARY KEY,
  program_name VARCHAR,
  program_description VARCHAR,
  program_duration INT
);

CREATE TABLE marginalized_populations (
  population_id INT PRIMARY KEY,
  population_name VARCHAR,
  population_description VARCHAR,
  population_size INT
);
